if __name__ == '__main__':

    from sol import print_sorted
    import doctest

    class weirdObject:
        def __repr__(self) -> str:
            return 'weird'

    # big one
    cont1 = {10 - a : list(tuple(set(d for d in range(c +1)) for c in range(b +1)) for b in range(a +1)) for a in range(11)}
    # cuvers alot of cases
    cont2 = (1, -2, [1, 2, (3, 3, {1}), 11, -20, [100, 66]], 123, weirdObject(), {weirdObject() : 22})

    # deep one
    cont3 = []
    cur = cont3
    for i in range(500):
        cur.append([])
        cur = cur[0]
    cur.append(cont1)
    cur.append(cont2)

    doctest.testmod(verbose = True)